const solid = ["faBars"];
const regular = [];
const brands = [];

export default {
  buildModules: [
    ["@nuxtjs/fontawesome", { component: "fontAwesome", suffix: true }],
  ],
  fontawesome: {
    icons: {
      solid: solid,
      regular: regular,
      brands: brands,
    },
  },
};
